function Assignments() {
    // In a real app, this data might come from an API
    const assignments = [
        { id: 1, title: 'Assignment 1', dueDate: '2024-03-10' },
        { id: 2, title: 'Assignment 2', dueDate: '2024-03-17' },
        { id: 3, title: 'Assignment 3', dueDate: '2024-03-24' },
    ];

    return (
        <div>
            <h2>Assignments</h2>
            <ul>
                {assignments.map((assignment) => (
                    <li key={assignment.id}>
                        <strong>{assignment.title}</strong> - Due by {assignment.dueDate}
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default Assignments;
